jQuery.extend({nette:{updateSnippet:function(d,a){var b=$("#"+d);var c=b.parent().find(".ajaxSpinner");if(b.hasClass("snippetSpinner")){b.fadeTo("fast",0.01,function(){c.transition({opacity:0});b.html(a).fadeTo("fast",1,function(){c.remove()})})}else{if(b.hasClass("snippetRoll")){b.html(a).fadeTo(500,1)}else{if(b.hasClass("snippetFadeOut")){b.fadeTo(250,0.01,function(){b.html(a).fadeTo(250,1)})}else{b.html(a)}}}},success:function(b){if(b.redirect){window.location.href=b.redirect;return}if(b.snippets){for(var a in b.snippets){jQuery.nette.updateSnippet(a,b.snippets[a])}}}}});jQuery.ajaxSetup({success:jQuery.nette.success,dataType:"json"});